import React from 'react';
import PropTypes from 'prop-types';
import InfoLineItem from './info-line-item';

const InfoLine = ({ data }) => {
  return (
    <div className="info-line">
      {data.map((item, index) => {
        return (
          <InfoLineItem {...item} key={index} />
        )
      })}
    </div>
  );
};

InfoLine.propTypes = {
  data: PropTypes.array,
};

export default InfoLine;
